export const cxLockChips = cxParts.filter((part) => part.kind === 'lock_chip')
export const cxMainBlades = cxParts.filter((part) => part.kind === 'main_blade')
export const cxAssistBlades = cxParts.filter(
  (part) => part.kind === 'assist_blade',
)

export const bladesByName = [...blades].sort((a, b) =>
  a.name.localeCompare(b.name, 'ja'),
)
export const bitsByCode = [...bits].sort((a, b) =>
  a.code.localeCompare(b.code, 'en'),
)
export const ratchetsByCode = [...ratchets].sort((a, b) => {
  const toNums = (code: string) =>
    code
      .split('-')
      .map((part) => Number(part.replace(/[^0-9]/g, '')) || 0)
  const [a1, a2] = toNums(a.code)
  const [b1, b2] = toNums(b.code)
  if (a1 !== b1) return a1 - b1
  return a2 - b2
})
